// 1) Get data
let allItems = $input.all();

// Try the most common scenario: allItems[0].json is already an array
let rows = allItems[0].json;

if (!Array.isArray(rows)) {
  // Maybe it's in allItems[0].json.data?
  if (allItems[0].json.data && Array.isArray(allItems[0].json.data)) {
    rows = allItems[0].json.data;
  } else {
    // Maybe each item is a single row:
    rows = allItems.map(item => item.json).flat();
  }
}

// If it's still not an array, throw an error
if (!Array.isArray(rows)) {
  throw new Error("We couldn’t find an array in the expected paths. Please check the output of the previous node.");
}

// 2) Initialize occupancy counters
const occupancyMap = {};

// 3) Loop through each row
rows.forEach(row => {
  // Get the property ID
  if (!row.hasOwnProperty("Property ID")) return;
  const propertyId = String(row["Property ID"]).trim();
  if (!propertyId) return;

  // Normalize status
  const status = String(row["Status"] || "").toLowerCase().trim();

  // Initialize if needed
  if (!occupancyMap[propertyId]) {
    occupancyMap[propertyId] = {
      total: 0,
      occupied: 0,
      projectedOccupied: 0
    };
  }

  // Increment total
  occupancyMap[propertyId].total += 1;

// Count as occupied
if (["current", "notice-rented", "notice-unrented"].includes(status)) {
  occupancyMap[propertyId].occupied += 1;
}

// Projected occupancy
if (["current", "vacant-rented", "notice-rented"].includes(status)) {
  occupancyMap[propertyId].projectedOccupied += 1;
}
});

// 4) Build output
const output = Object.keys(occupancyMap).map(propertyId => {
  const { total, occupied, projectedOccupied } = occupancyMap[propertyId];
  const occRate = total > 0 ? ((occupied / total) * 100).toFixed(2) + "%" : "0.00%";
  const projectedRate = total > 0 ? ((projectedOccupied / total) * 100).toFixed(2) + "%" : "0.00%";

  return {
    "Property ID": propertyId,
    "Total Units": total,
    "Occupied Units": occupied,
    "Occupancy Rate": occRate,
    "Projected Occupied Units": projectedOccupied,
    "Projected Occupancy Rate": projectedRate
  };
});

// 5) Return final occupancy results
return output;
